private Document newDoc() {
  Document d = new Document();
  float boost = nextNorm();
  for (int i = 0; i < 10; i++) {
    Field f = new Field("f"+i,"v"+i,Store.NO,Index.UN_TOKENIZED);
    f.setBoost(boost);
    d.add(f);
  }
  return d;
}

